  .mdc-text-field--filled {
    @include _filled($query);

    &.mdc-text-field--no-label {
      @include _filled-no-label($query);
    }
  }

  .mdc-text-field--outlined {
    @include outlined_($query);

    .mdc-notched-outline {
      @include _outlined-notched-outline($query);
