    .mdc-top-app-bar--prominent {
      .mdc-top-app-bar__title {
        padding-bottom: variables.$prominent-mobile-title-bottom-padding;
      }
    }

    .mdc-top-app-bar--fixed-adjust {
      padding-top: variables.$mobile-row-height;
    }
  }
}

