:root {
    --mdc-theme-primary: #40c4ff;
    --mdc-theme-background: #ffffff;
    --divider-color: rgba(0, 0, 0, 0.12);
    --el1: #212121;
    --el2: #eeeeee;
    --drawer-bg: #eeeeee;
    --btn-color: #cccccc;
    --color: #404040;
    --light-color: #ffffff;
    --dark-color: #ffffff;
}

* {
    user-select: none;

    &:focus {
        outline: none !important;
    }
}

body {
    overflow-x: hidden;
    height: 100vh;
    width: 100vw;

    .app-bar {
        position: relative;
        z-index: 9;
    }

    .mdc-drawer {
        margin-top: -64px;
        @include item-activated-text-ink-color(#40c4ff);
        @include item-activated-icon-ink-color(#40c4ff);
    }

    .mdc-drawer-app-content {
        transition: all 0.2s ease-in-out;

        .main-content {
            margin-top: -64px;
            background-color: white;

            .info {
                margin: 20px;
            }

            .row {
                .col {
                    display: flex;
                    justify-content: center;
                    padding: 12px;
                    height: fit-content;
                }
            }
        }
    }
    .footer {
        top: 100vh;
        width: 100vw;
        position: absolute;
    }
}
